        axios.get("http://localhost:3004/isAuthenticated").then((data)=>{
         setisAuth(true)

         }).catch((err)=>{
            setisAuth(false)

         })



      },[])
    return (
       <>

{ isAuth && isAuth === true ? <Outlet /> : <Navigate to="/login" />
}

       </>
    )
}

